import styled from "styled-components";

const Main = styled.div`
  display: flex;
  justify-content: center;
  padding-top: 5rem;
  background-color: aliceblue;
`;

function MainPage() {
  return (
    <Main>
      <span>Main Page</span>
    </Main>
  );
}

export default MainPage;
